script: |
  super -f text -I q5750.spq | sort > q5750.out

inputs:
  - name: q5750.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 99 * - - col1 / + - col0 * + col0 BETWEEN + 32 * - + col1 - 19 AND ( NULL );
  - name: tab2

outputs:
  - name: q5750.out
    data: |
